import './ShowResults.css';

const ShowResults = (props) => {
	return (
		<div>
			console.log({props.Distance}) console.log(props.fuel_cost) console.log(
			{props.costByDay})
			<h1>
				Łączny koszt wynajmu: {parseInt(props.Distance) * props.fuel_cost}
			</h1>
			<ul>
				<li>Koszt paliwa: {parseInt(props.Distance) * props.fuel_cost} </li>
				<li>
					Koszt spowodowany czasem posiadania prawa jazdy:{' '}
					{parseInt(props.Distance) * props.fuel_cost}{' '}
				</li>
				<li>
					Koszt marką samochodu: {parseInt(props.Distance) * props.fuel_cost}{' '}
				</li>
				<li>
					Koszt liczbą modeli samochodu:{' '}
					{parseInt(props.Distance) * props.fuel_cost}{' '}
				</li>
				<li>Koszt netto: {parseInt(props.Distance) * props.fuel_cost} </li>
				<li>Koszt brutto: {parseInt(props.Distance) * props.fuel_cost} </li>
			</ul>
			<button onClick={props.Change}>Wróć</button>
		</div>
	);
};

export default ShowResults;
